import styled from "styled-components";

export const Nav = styled.nav`
  width: 100%;
  height: 90px;
  padding: 0 20px;
  display: flex;
  align-items: center;
  position: fixed;
  justify-content: space-between;
  // above all elements
  /* z-index: 98; */
  background: rgba(102, 51, 153, 0.8);
  // animate and move the Nav
  transition: all 2s ease-in-out;
`;

export const NavBar = () => {
  return (
    <>
      <Nav>
        {/* <div>
          <a href="#logo section"></a>
        </div> */}
        <div>Menu Icon</div>
        <div>Nav List</div>
      </Nav>
    </>
  );
};
